const e=JSON.parse('{"key":"v-76f251d2","path":"/daily/copy-code-may-not-be-guilty.html","title":"复制代码也许不是罪","lang":"zh-CN","frontmatter":{"date":"2023-09-24T00:00:00.000Z","tag":["Daily"],"description":"复制代码也许不是罪 前言 熟悉我的人都知道，我对代码是有追求的。 正式参加工作后，我就知道，复制粘贴是坏的实践，自己一直极力避免做这样的事。要是遇到了别人复制粘贴，要么喷，要么自己改。 我早期认为：复制代码就是菜。 后来认为：复制代码可能不是菜，而是懒，没有素养，自我要求。 而现在：代码其实也没那么重要；某些情况下复制粘贴是可以接受的。 编码经过七个年头，我思想上为何会有如此改变？难道这就是传说中的七年之痒?","head":[["meta",{"property":"og:url","content":"https://levy.vip/daily/copy-code-may-not-be-guilty.html"}],["meta",{"property":"og:site_name","content":"levy"}],["meta",{"property":"og:title","content":"复制代码也许不是罪"}],["meta",{"property":"og:description","content":"复制代码也许不是罪 前言 熟悉我的人都知道，我对代码是有追求的。 正式参加工作后，我就知道，复制粘贴是坏的实践，自己一直极力避免做这样的事。要是遇到了别人复制粘贴，要么喷，要么自己改。 我早期认为：复制代码就是菜。 后来认为：复制代码可能不是菜，而是懒，没有素养，自我要求。 而现在：代码其实也没那么重要；某些情况下复制粘贴是可以接受的。 编码经过七个年头，我思想上为何会有如此改变？难道这就是传说中的七年之痒?"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-12-30T03:23:20.000Z"}],["meta",{"property":"article:author","content":"levy"}],["meta",{"property":"article:tag","content":"Daily"}],["meta",{"property":"article:published_time","content":"2023-09-24T00:00:00.000Z"}],["meta",{"property":"article:modified_time","content":"2023-12-30T03:23:20.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"复制代码也许不是罪\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2023-09-24T00:00:00.000Z\\",\\"dateModified\\":\\"2023-12-30T03:23:20.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"levy\\"}]}"]]},"headers":[{"level":2,"title":"前言","slug":"前言","link":"#前言","children":[]},{"level":2,"title":"正文","slug":"正文","link":"#正文","children":[]}],"git":{"createdTime":1703906600000,"updatedTime":1703906600000,"contributors":[{"name":"levy","email":"897895407@qq.com","commits":1}]},"readingTime":{"minutes":1.51,"words":453},"filePathRelative":"daily/copy-code-may-not-be-guilty.md","localizedDate":"2023年9月24日","excerpt":"<h1> 复制代码也许不是罪</h1>\\n<h2> 前言</h2>\\n<p>熟悉我的人都知道，我对代码是有追求的。</p>\\n<p>正式参加工作后，我就知道，复制粘贴是坏的实践，自己一直极力避免做这样的事。要是遇到了别人复制粘贴，要么喷，要么自己改。</p>\\n<p>我早期认为：复制代码就是菜。</p>\\n<p>后来认为：复制代码可能不是菜，而是懒，没有素养，自我要求。</p>\\n<p>而现在：代码其实也没那么重要；某些情况下复制粘贴是可以接受的。</p>\\n<p>编码经过七个年头，我思想上为何会有如此改变？难道这就是传说中的七年之痒?</p>\\n","autoDesc":true}');export{e as data};
